import './table.css';

class Table extends Component {
    render () {

        return (
            <>
                <div>
                    <div class="grid grid-flow-row lg:grid-cols-1 grid-rows-1 gap-4">
                        <div className="card card-custom gutter-b poppins bg-white border-0	mb-5">
                            <div className="px-8 py-9 border border-b border-gray-400 text-gray-900">Customized Tables</div>
                            <div className="px-8 py-9">
                                <span className="text-xs text-gray-900">Here is an example of customizing the component.</span>
                            </div>
                        </div>
                    </div>    
                </div>
            </>
        )
    }
}

export default Table;
